import React, { useEffect, useState } from "react";
import loginService from "../../../services/login";
import { useHistory } from "react-router-dom";

const Login = () => {
    const history = useHistory();
    const [email, setEmail] = useState("");
    const [password, setPassword] = useState("");
    const [user, setUser] = useState(null);
    const [errorMessage, setErrorMessage] = useState(null)

    useEffect(() => {
        const currentUserJSON = window.localStorage.getItem("user");
        if (currentUserJSON) {
            const user = JSON.parse(currentUserJSON);
            setUser(user);
        }
    }, []);

    const processLogin = async (event) => {
        event.preventDefault();
        try {
            const user = await loginService.login({
                email, password
            });

            window.localStorage.setItem(
                "user", JSON.stringify(user)
            );
            window.localStorage.setItem("firstLoad", true);

            setUser(user);
            setEmail("");
            setPassword("");
            history.push("/");
            if (localStorage.getItem("firstLoad")) {
                window.localStorage.removeItem("firstLoad");
                window.location.reload();
            }
        } catch (exception) {
            setErrorMessage("Login details didnt match!");
            setTimeout(() => {
                setErrorMessage(null);
            }, 5000);
            return errorMessage;
        }
    };

    const loginForm = () => {
        return (
            <>
                <form onSubmit={processLogin} className="login-form">
                    <h1>Login</h1>
                    <p>{errorMessage}</p>
                    <div className="login-form-input">
                        <input
                        type="text"
                        value={email}
                        name="email"
                        placeholder="Email"
                        autoComplete="on"
                        onChange={({ target }) => setEmail(target.value)}
                        required />
                    </div>
                    <div className="login-form-input">
                        <input 
                        type="password"
                        value={password}
                        name="password"
                        placeholder="Password"
                        autoComplete="on"
                        onChange={({ target }) => setPassword(target.value)}
                        required />
                    </div>
                    <p>
                        Don't have an account?
                    </p>
                    <a href="/account/register">Register here!</a>
                    <button type="submit" className="login-form-button">Login</button>
                </form> 
            </>
        );
    };

    return (
        <>
            <div className="page-wrapper">
                <div className="page-container login">
                    {user === null && loginForm()}
                </div>
            </div>
        </>
    );
};

